
/**
 * Font Injection Service for jsPDF
 */

const CENTURY_NORMAL = '';
const CENTURY_BOLD = ''
const POPPINS_NORMAL = '';
const POPPINS_BOLD = '';

// Placeholder for custom icon/symbol font if ZapfDingbats isn't enough
const SYMBOLS_NORMAL = 'PASTE_SYMBOL_FONT_BASE64_HERE';

// Added interface for font style structure to prevent TypeScript errors when iterating over CUSTOM_FONTS
interface FontStyles {
  normal: string;
  bold?: string;
}

// Explicitly typed CUSTOM_FONTS as a Record to ensure consistent property access for name/styles entries
export const CUSTOM_FONTS: Record<string, FontStyles> = {
  'Century': {
    normal: CENTURY_NORMAL,
    bold: CENTURY_BOLD,
  },
  'Poppins': {
    normal: POPPINS_NORMAL,
    bold: POPPINS_BOLD,
  },
  'Icons': {
    normal: SYMBOLS_NORMAL,
  }
};

export const registerFonts = (doc: any) => {
  Object.entries(CUSTOM_FONTS).forEach(([name, styles]) => {
    if (styles.normal && styles.normal.length > 100) {
      const normalFile = `${name}-Normal.ttf`;
      doc.addFileToVFS(normalFile, styles.normal);
      doc.addFont(normalFile, name, 'normal');
    }
    // Fix: Properly check if optional bold property exists on the current font style object
    if (styles.bold && styles.bold.length > 100) {
      const boldFile = `${name}-Bold.ttf`;
      doc.addFileToVFS(boldFile, styles.bold);
      doc.addFont(boldFile, name, 'bold');
    }
  });
};
